import React,  {useState} from "react";
import "./App.css"


export default () => {
     const [todos, setTodos] = useState([])

     return (
          <div>
               <form className='form-todolist'>
                    <input type='text' placeholder='todoList...' onChange={ e => setTodos(
                         e.target.value
                    )}>     
                    </input>
                    <button type='submit'>
                    Add
                    </button>
               </form>
          </div>
     )
}
